import styled from "styled-components/macro";

const Wrapper = styled.div`
  .nav-links {
      font-size: 11px;
  }

  .capco-logo {

    width: 85px;
    height: 30.38px;
    left: calc(50% - 170px/2 - 715px);
    top: 10px;
    padding-right: 20px; 
    margin-top: 10px;
  }

  .logo-text {
    height: auto;
    width: auto;
    padding-bottom: 23px;

  }
  .capco-logo, .logo-text {
    display: inline-block;
  }

  .logo-text, .nav-links {
      font-family: 
      Ubuntu Mono;
  }
`;

export default Wrapper;
